import React, { Component } from 'react'
import axios from 'axios';

class PostList extends Component {
     constructor(props) {
         super(props)
     
         this.state = {
              posts:[],
              ipl:[],
              error:""
         }
     }
     
     componentDidMount(){
         axios.get('https://cricapi.com/api/matches/rXH9Y3RJu3YVsF51R6FSTwLR24h2')
         .then(Response=>{
             //console.log(Response.data.matches)
             this.setState({
                posts:Response.data.matches
             })
            this.state.posts.map(post=>
                this.setState({
                   ipl:post
                }))
         })
         .catch(error=>{
            //console.log(error)
             this.setState({
                 error: "bahot error"
             })
         })
     }

    render() {
        const {posts,ipl,error}=this.state
        console.log(ipl)
        return (
            <div>
               <h1> List Of Matches</h1>
                {
                    posts.length?
                    posts.map(post =>
                    <div key={post.unique_id}>
                    <li>{post["team-1"]} --<b>VS</b>-- {post["team-2"]}</li>
                    <div> WINNER== {post["winner_team"]}</div></div>):
                    null
                }
                {
                    error.length?<div>{error}</div>:null
                }
            </div>
        )
    }
}

export default PostList
